import React from 'react'
import styled from 'styled-components'
import { Icon } from 'antd'

const CardTitile = styled.h3`
  color: #8c8c9c;
`
const CardDetail = styled.div`
  border-bottom: 1px solid #eaedf3;
  margin-bottom: 15px;
  padding: 0 0 10px 0;
  ul {
    will-change: position, transform;
    list-style-type: none;
    margin: 0px;
    padding: 0px;
    li {
      padding-left: 5px;
      line-height: 2.5;
      overflow: hidden;
      text-overflow: ellipsis;
      display: -webkit-box;
      -webkit-line-clamp: 1;
      -webkit-box-orient: vertical;
    }
  }
`

const Left = () => {
  return (
    <>
      <CardDetail>
        <CardTitile>จังหวัดแนะนำ</CardTitile>
        <ul>
          <li>
            <Icon type="caret-right" /> กรุงเทพมหานคร
          </li>
          <li>
            <Icon type="caret-right" /> สมุทรสงคราม
          </li>
          <li>
            <Icon type="caret-right" /> เชียงใหม่
          </li>
          <li>
            <Icon type="caret-right" /> กาญจนบุรี
          </li>
          <li>
            <Icon type="caret-right" /> เพชรบูรณ์
          </li>
        </ul>
      </CardDetail>
      <CardDetail>
        <CardTitile>รายการแนะนำ</CardTitile>
        <ul>
          <li>
            <Icon type="caret-right" /> ไปแหล่น เชียงคาน นำเด้อ! มาราธอน 2019
          </li>
          <li>
            <Icon type="caret-right" /> PWA Mini Marathon 2019
          </li>
          <li>
            <Icon type="caret-right" /> ลันตา แอดเวนเจอร์ เรซ 2562
          </li>
          <li>
            <Icon type="caret-right" /> Beach Run – Virtual Run
          </li>
          <li>
            <Icon type="caret-right" /> นครสวรรค์ มาราธอน 2562
          </li>
        </ul>
      </CardDetail>
    </>
  )
}

export default Left
